import React from 'react';
import './Footer.css';

const Footer = () => {
  const currentYear = new Date().getFullYear();
  
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; {currentYear} Matthew Eng. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
